--Tạo database--------------------------------------------------------------

create table RoomTypes (
	TypeID INT,
	RoomType VARCHAR(1),
	Price INT
);

create table RoomStatus (
	StatusID INT,
	StatusName VARCHAR(7),
	StatusColor VARCHAR(5)
);

create table Rooms (
	RoomId INT,
	RoomName INT,
	TypeID VARCHAR(3),
	StatusID VARCHAR(3)
);

create table Orders (
	OrderId INT,
	Confirm VARCHAR(50),
	Pay VARCHAR(50),
	QuantityGuest INT,
	RoomId VARCHAR(4),
	CheckIn DATE,
	CheckOut DATE
);

create table Guests (
	GuestId INT,
	Address VARCHAR(50),
	FullName VARCHAR(50),
	IdentityNumber VARCHAR(50),
	PhoneNumber VARCHAR(50),
	Nation VARCHAR(50)
);

create table OrderDetails (
	OrderDetailId INT,
	OrderId VARCHAR(7),
	UserId VARCHAR(50),
	GuestId VARCHAR(6)
);

create table Payments (
	PaymentId INT,
	CustomerId VARCHAR(6),
	TotalPay INT,
	Factor INT,
	OrderId VARCHAR(7)
);

--Tạo database--------------------------------------------------------------

