/* cập nhật hàng trong kho sau khi đặt hàng hoặc cập nhật */
CREATE TRIGGER [dbo].[trg_Order] ON [dbo].[Orders] AFTER INSERT AS 
IF( (SELECT Confirm from inserted) <> 0)
BEGIN
	UPDATE Rooms
	SET StatusID = 2
	FROM Rooms
	JOIN inserted ON Rooms.RoomId = inserted.RoomId
END
IF( (SELECT Confirm from inserted) = 0)
BEGIN
	UPDATE Rooms
	SET StatusID = 4
	FROM Rooms
	JOIN inserted ON Rooms.RoomId = inserted.RoomId
END
GO

CREATE TRIGGER [dbo].[trg_Cancel_Order] ON [dbo].[Orders] FOR DELETE AS 
BEGIN
	UPDATE Rooms
	SET StatusID = 1
	FROM Rooms
	JOIN deleted ON Rooms.RoomId = deleted.RoomId
END
GO

CREATE TRIGGER [dbo].[trg_update_Order] on [dbo].[Orders] after update AS
IF ((SELECT RoomId from inserted ) <>0)
BEGIN
   UPDATE Rooms 
   SET StatusID = 2 
   FROM Rooms
   JOIN inserted ON Rooms.RoomId=inserted.RoomId
end
IF ((SELECT RoomId from deleted ) <>0)
BEGIN
   UPDATE Rooms 
   SET StatusID = 1 
   FROM Rooms
   JOIN deleted ON Rooms.RoomId=deleted.RoomId
end
IF ((SELECT Pay from inserted ) <>0)
BEGIN
   UPDATE Rooms 
   SET StatusID = 1
   FROM Rooms
   JOIN inserted ON Rooms.RoomId=inserted.RoomId
end
GO

CREATE TRIGGER [dbo].[trg_confirm_Order] on [dbo].[Orders] after update AS
IF ((SELECT Confirm from inserted) <> 0)
BEGIN
   UPDATE Rooms 
   SET StatusID = 2 
   FROM Rooms
   JOIN inserted ON Rooms.RoomId=inserted.RoomId
end
IF ((SELECT Confirm from inserted) = 0)
BEGIN
   UPDATE Rooms 
   SET StatusID = 4 
   FROM Rooms
   JOIN inserted ON Rooms.RoomId=inserted.RoomId
end
go

CREATE TRIGGER [dbo].[trg_pay_Order] on [dbo].[Orders] after update AS
IF ((SELECT Pay from inserted) <> 0)
BEGIN
   UPDATE Rooms 
   SET StatusID = 1 
   FROM Rooms
   JOIN inserted ON Rooms.RoomId=inserted.RoomId
end
GO

