--Stored Procedure-----------------------------------------------------------
CREATE PROCEDURE sp_DanhThuTheoThang
(
	@Thang INT
)
AS 
BEGIN
SELECT RoomTypes.TypeName as LoaiPhong, sum(Payments.TotalPay) as Danhthu, CAST (Count (*) * 100.0 / sum (Count (*)) over () AS DECIMAL (18, 2)) as TiLe
FROM Payments Inner Join Orders On Payments.OrderId = Orders.OrderId Inner Join Rooms On Orders.RoomId = Rooms.RoomId Inner Join RoomTypes On Rooms.TypeID = RoomTypes.TypeID
Where Payments.OrderId = Orders.OrderId and Orders.RoomId = Rooms.RoomId and month(Orders.CheckIn) =  @Thang
group by RoomTypes.TypeName 
end
go
EXEC sp_DanhThuTheoThang 7
drop procedure sp_DanhThuTheoThang
